import React from 'react';

import Flag_of_France from './Flag_of_France.svg';
import Flag_of_USA from './Flag_of_USA.svg';

function City(props){
//functional component
return (

            <div>

                    {props.USA === true && <div className='city_container'>You're going to New York City! <br/>The time is now {props.time}<br/><img src={Flag_of_USA} alt='French Flag' /></div>}
                    {props.France === true && <div className='city_container'>You're going to Paris!<br/><img src={Flag_of_France} alt='French Flag' /></div>}

            </div>
)};

export default City;
